  `evaluation_times` int(11) DEFAULT NULL COMMENT '评价次数',
  `have_pictrue_evaluation_times` int(11) DEFAULT NULL COMMENT '有图评价次数',
  `sales_count` int(11) DEFAULT NULL COMMENT '销量',
  `brush_single_times` int(11) DEFAULT NULL COMMENT '刷单数量',
  `brush_single_cost` double(8,2) DEFAULT NULL COMMENT '刷单成本',
  `details_optimization` int(4) NOT NULL DEFAULT '0' COMMENT '详情是否优化(1:是，2：否)',
  `remark` varchar(1000) DEFAULT NULL COMMENT '备注',
  `analyze` varchar(1000) DEFAULT NULL COMMENT '分析',
  `create_by` varchar(30) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(30) DEFAULT NULL COMMENT '修改人',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
