  UNIQUE KEY `agd` (`start_name`,`type`),
  KEY `idx_create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=1306 DEFAULT CHARSET=utf8mb4 COMMENT='商品详情表';

